import React from 'react';

export default function Internships() {
  const internships = [
    {
      title: "Software Developer Intern – Smart Desert Pvt Ltd",
      period: "Jul 2021 – Dec 2021",
      desc: `Created wireframes, prototypes, and high-fidelity mockups for the "Excelli Super App" cab booking feature using Figma. Delivered front-end solutions with HTML/CSS/JavaScript and ensured project reliability via code reviews and documentation.`
    },
    {
      title: "Teaching Assistant – SUNY New Paltz",
      period: "Jan 2024 – May 2024",
      desc: `Built a full-stack AI-powered grading website using Node.js, SQL, ChatBot API, and React. Improved grading efficiency by 80% and managed communications with Tableau/Power BI reporting.`
    }
  ];

  return (
    <section id="internships">
  <h2 style={{ fontSize: '2rem', fontWeight: 'bold', color: 'white', padding: '2rem 0' }}>
    <span style={{ borderBottom: '3px solid #3b82f6' }}>My Internships</span>
  </h2>
  <div className="timeline">
    <div className="timeline-item">
      <div className="timeline-dot" />
      <div className="timeline-content">
        <h3><strong>Software Developer Intern – Smart Desert Pvt Ltd</strong></h3>
        <p><i>Jul 2021 – Dec 2021</i></p>
        <p>Created wireframes and high-fidelity mockups for the "Excelli Super App" cab booking feature using Figma. Delivered front-end solutions with HTML/CSS/JavaScript and ensured project reliability via code reviews and documentation.</p>
      </div>
    </div>

    <div className="timeline-item">
      <div className="timeline-dot" />
      <div className="timeline-content">
        <h3><strong>Teaching Assistant – SUNY New Paltz</strong></h3>
        <p><i>Jan 2024 – May 2024</i></p>
        <p>Built a full-stack AI-powered grading website using Node.js, SQL, ChatBot API, and React. Improved grading efficiency by 80% and managed communications with Tableau/Power BI reporting.</p>
      </div>
    </div>
  </div>
</section>
  );
}
